// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <8.12.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


import "./LotteryVault.sol";


contract Lottery is Ownable {
 using SafeMath for uint256;

    uint256 public entryFee;
    uint256 public currentPot;
    uint256 public lotteryEndBlock;

    // max limit for entrantsArrayReturn
    uint8 public maxLimit = 10;

    // 
    uint8 public winnerSplit = 9;

    bool public lotteryRunning;

    address public don;
    address payable public company;
    address payable public LotteryVaultAddress;
    LotteryVault private vault;

    // entrant address => entered ( true or false )
    mapping(address => bool) public Entrants;

    // array of all entrants entered in lottery
    address payable[] public EntrantsArray;

    // address of the last winner 
    address public LastWinner;

    //Events
    event NewEntrant(address indexed entrant);
    event LotteryStarted(uint indexed startblock, uint indexed endblock);
    event LotteryWinner(address indexed lotterywinner, uint indexed winningpot);

    modifier onlyDon {
      require(msg.sender == don, "Only the don can start the lottery");
      _;
   }

    modifier onlyCompany {
      require(msg.sender == company, "Only the company can start the lottery");
      _;
   }

    constructor(address _don, address payable _company, address payable _lotteryvault) {
        entryFee = 40000000000000000;
        currentPot = 0;
        don = _don;
        lotteryEndBlock = 0;
        lotteryRunning = false;
        company = _company;
        LotteryVaultAddress = _lotteryvault;
    }

    function setEntryFee(uint256 _entryfee) external onlyDon {
        entryFee = _entryfee;
    }

    function setMaxLimit(uint8 _maxLimit) public onlyOwner{
        maxLimit = _maxLimit;
    }

    //only don can set new don? or owner? 
    function setNewDon(address _address) external onlyOwner {
        don = _address;
    }

    // set new company address
    function setNewCompany(address payable _address) external onlyOwner {
        company = _address;
    }

    function setWinnerSplit(uint8 _split) external onlyCompany {
        require(_split > 0, "split has to be greater than 0");
        require(_split < 11, "split has to be 10 or less");
        winnerSplit = _split;
    }


    function getEntrantsArray(uint256 limit, uint256 offset) view external returns(address[] memory entrantsArraySlice) {

        uint256 size = EntrantsArray.length < limit  ? EntrantsArray.length : limit;

        size = size < maxLimit ? size : maxLimit;

        entrantsArraySlice = new address[](size);

        for(uint256 i = 0; i < size; i++){
            entrantsArraySlice[i] = EntrantsArray[i + offset];
        }

        return entrantsArraySlice;
    }

    function checkIfAddressIsEntered(address _address)  view external returns(bool){
        return Entrants[_address];
    }



    // Handle the entering of new Entrants into the lottery
    function enter(address payable _newentrant) payable external {
        //require the corect entry fee
        require(msg.value == entryFee, "Sending wrong cost of entry");

        //require that address is not already entered
        require(Entrants[_newentrant] == false, "Address already entered into lottery");

        // require lottery to be running
        require(lotteryRunning == true, "Lottery has to be running");

        //update entry status of new entrant
        Entrants[_newentrant] = true;

        //add entrant address to address payable array
        EntrantsArray.push(_newentrant);

        //add 90% of new entry to pot
        currentPot = currentPot.add(entryFee);

        emit NewEntrant(_newentrant);
    }

    function lotteryStart(uint _lotterytime) external onlyDon {

        require(lotteryRunning == false, "The lottery can only start if it is ended");

        lotteryRunning = true;

        lotteryEndBlock = SafeMath.add(block.number, _lotterytime);

        emit LotteryStarted(block.number, lotteryEndBlock);
    }


    // --- handle ending the lottery --- 
    function lotteryEnd() external onlyDon {

        // require that the current block number is larger than our end date
        require(block.number > lotteryEndBlock, "Lottery Endblock is in the past");

        // require that the lottery hasnt already ended
        require(lotteryRunning == true, "Lottery isn't running");

        //set end flag to true
        lotteryRunning = false;

        // need to handle case where EntrantsArray is null ( 0 entrants ) 
        if(EntrantsArray.length > 0){

            // payout to random winner
            payout(EntrantsArray[random()], currentPot.div(10).mul(winnerSplit));

            // iterate through our entrants mapping using EntrantsArray as keys and reset their values to false
            for(uint i=0; i< EntrantsArray.length; i++){
                Entrants[EntrantsArray[i]] = false; 
            }

            // delete the EntrantsArray
            delete EntrantsArray;
        }

    }

    // withdraw our 10% to vault -- 10% will be remaining in contract after pot is transfered to winner vault
    function withdrawToCompany() public onlyCompany {
        require(lotteryRunning == false);
        company.transfer(address(this).balance);
    }


    // ---- handle paying out to the winner of the lottery --- 
    function payout(address payable winner, uint256 pot) internal {
        // use local pot variable to help prevent re entrancy ( even though this function is internal and only callable by don)
        currentPot = 0;
        vault = LotteryVault(LotteryVaultAddress);
        // Send pot value with winner to vault deposit contract for future withdraw by winner
        vault.deposit{value: pot}(winner);
        emit LotteryWinner(winner, pot);
        LastWinner = winner;
    }

    // pseudorandom number generator to get random number from range 0 - # of particpants 
    function random() internal view returns (uint256) {
        uint256 seed = uint256(keccak256(abi.encodePacked(
            block.timestamp + block.difficulty +
            ((uint256(keccak256(abi.encodePacked(block.coinbase)))) / (block.timestamp)) +
            block.gaslimit + 
            ((uint256(keccak256(abi.encodePacked(msg.sender)))) / (block.timestamp)) +
            block.number
        )));

        return (seed % EntrantsArray.length);
    }


}
